description:
The Nowhere Boys have found their way home, but Felix, Jake, Sam and Andy soon discover the adventure doesn't stop just because they're back.
As they experiment with their new and unpredictable powers over earth, wind, fire and water, the boys realise they aren't the only ones who crossed back to this universe.

